_DESCRIPTION_:
AccordTec ML-295KB (коричневый) предназначен для использования в системах контроля доступа и автоматикипоарных и запасных выходов, а также в помещениях, где предъявляются самые жесткие требования к исполнительному механизму:
высокая надежнсть;
исключительная износоустойчивость;
вандалозащищенность.

REXANT разъем штекер BNC с клеммной колодкой (05-3076) предназначен для подключения коаксиального кабеля c волновым сопротивлением 50 или 75 Ом, к видеокамерам, видеорегистраторам, мониторам и другим радиоэлектронным устройствам. BNC-коннектор (BNC сокр. от Bayonet Neill Concelman) с клеммной колодкой - электрический разъем с байонетной фиксацией закрепляется на кабеле зажимом с помощью винтов. Этот способ крепления значительно проще и быстрее, чем пайка и обжим, но его надежность и качество соединения остаются на неизменно высоком уровне. 

BNC-разъем изготовлен из материалов:
корпус - никелированный цинк и высокопрочный пластик;
центральный контакт - латунь с напылением технического золота;
диэлектрик - фторопласт.

Диапазон рабочих температур от -40℃ до +110℃. Использование сплава меди (биметалл) и никелевого покрытия повышает долговечность разъема и позволяет применять в условиях климатических перепадов.

PROCONNECT разъем штекер BNC-59 пайка (01-006B)  05-3012-4 предназначен для подключения коаксиального кабеля c волновым сопротивлением 50 или 75 Ом к видеокамерам, видеорегистраторам, мониторам и другим радиоэлектронным устройствам. BNC-коннектор (BNC сокр. от Bayonet Neill Concelman) под пайку - электрический разъем с байонетной фиксацией закрепляется на кабеле с помощью пайки (центральная жила - пайка, а оплетка - накрутка). Соединение такого типа позволит передать сигнал с минимальным уровнем потерь между проводниками кабеля и штекером, создавая наиболее качественный контакт. 

BNC-разъем изготовлен из материалов:
корпус - никелированный цинк;
центральный контакт - латунь с напылением технического золота;
диэлектрик - фторопласт;
хвостовая часть - никелированный металл.

Диапазон рабочих температур от -40℃ до +110℃. Использование сплава меди (биметалл) и никелевого покрытия повышает долговечность разъема и позволяет применять в условиях климатических перепадов.

Основные  характеристики модуля сопряжения МСК:Назначение контактов:
Аудио от вызывной панели;
Общий провод вызывной панели;
Видеосигнал от вызывной панели;
Аудиосигнал для видеодомофона;
Общий провод видеодомофона;
Видеосигнал для видеодомофона;
Видеосигнал от подъездной видеокамеры;
Общий провод подъездной видеокамеры/домофона (состояние по-умолчанию);
для версии плат, начиная с 2d, возможно подключение сигнала HOOK в положении перемычки J1 2-3;
Абонентская линия от домофона (положительный контакт, десятки);
Абонентская линия от домофона (отрицательный контакт, единицы);
